import React, { Component } from "react";
import "../css/assignment.css";

class Assignment extends Component {
  state = {
    no: "01",
    name: "Assignment Name",
    description: "Lorem ipsum dolor set amet",
    datatime: "25th March 2022",
    timerem: "10H: 20M: 30S",
  };
  render() {
    return (
      <div className="cont">
        <p className="no">{this.state.no}</p>
        <div className="textparent">
          <div className="name-details">
            <p className="name">{this.state.name}</p>
            <p className="details">{this.state.description}</p>
          </div>
          <div className="submission-details">
            <p className="subdate">{this.state.datatime}</p>
            <p className="time-rem">{this.state.timerem}</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Assignment;
